      <RecommendWrapper>
        <RecommendItem imgUrl="https://cdn2.jianshu.io/assets/web/banner-s-3-7123fd94750759acf7eca05b871e9d17.png" />
      </RecommendWrapper>
    );
  }
}

export default Recommend;
